window.onload = function init() {
    canvas = document.getElementById( "gl-canvas" );

    gl = WebGLUtils.setupWebGL( canvas );
    if ( !gl ) { alert( "WebGL isn't available" ); }

    gl.clearColor(0.4, 0.4, 0.4, 1);
	
	var program = initShaders( gl, "vertex-shader", "fragment-shader" );
    gl.useProgram( program );
    
    aspect=canvas.width/canvas.height;
	prepareSword();

	var vBuffer = gl.createBuffer();
    gl.bindBuffer( gl.ARRAY_BUFFER, vBuffer);
    gl.bufferData( gl.ARRAY_BUFFER, new Float32Array(vertices), gl.STATIC_DRAW);

    var vPosition = gl.getAttribLocation( program, "vPosition");
    gl.vertexAttribPointer( vPosition, 3, gl.FLOAT, false, 0, 0);
    gl.enableVertexAttribArray( vPosition);
	
	var iBuffer = gl.createBuffer();
	gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, iBuffer);
	gl.bufferData(gl.ELEMENT_ARRAY_BUFFER, new Uint8Array(indices), gl.STATIC_DRAW);

    
    /*vTextureCoord Buffer*/
    var buffer = gl.createBuffer();
    gl.bindBuffer(gl.ARRAY_BUFFER, buffer);
    gl.bufferData(gl.ARRAY_BUFFER,new Float32Array(texturesCoords),gl.STATIC_DRAW);

    var texcoordLocation = gl.getAttribLocation(program, "a_texcoords");
    if(texcoordLocation!==-1)
    {
        gl.enableVertexAttribArray(texcoordLocation);
        gl.vertexAttribPointer(texcoordLocation, 2, gl.FLOAT, false, 0, 0);
    }
    /*Texture Initialization*/
    var texture = gl.createTexture();
    gl.bindTexture(gl.TEXTURE_2D, texture);
    gl.texImage2D(gl.TEXTURE_2D, 0, gl.RGBA, 64, 64, 0, gl.RGBA, gl.UNSIGNED_BYTE,
                myTexels);
     gl.generateMipmap(gl.TEXTURE_2D, texture);
    gl.uniform1i(gl.getUniformLocation(program, "texMap"), 0);

	document.addEventListener('keydown', keyPressed);
    document.addEventListener('keyup', keyReleased);   
      
	modelViewMatrix = rotateX(0);
	modelViewMatrixLoc = gl.getUniformLocation( program, "modelViewMatrix" );
    projectionMatrixLoc = gl.getUniformLocation( program, "projectionMatrix" );
    //Orthogonal projection or perspective projection
    Projection();

    gl.uniformMatrix4fv( modelViewMatrixLoc, false, flatten(modelViewMatrix));
	gl.uniformMatrix4fv( projectionMatrixLoc, false, flatten(projectionMatrix)); 
    // Receive button wireframe or not and orthogonal or perspective.
	button1.addEventListener("click",Version);
    button2.addEventListener("click",Projection);
	
	setInterval(render, 1000 / 60);
};
function prepareSword() {
	for (var i = 0; i < quads.length; i+=12) {
		indices.push(quads[i]-1, quads[i+3]-1, quads[i+6]-1); 
		indices.push(quads[i]-1, quads[i+6]-1, quads[i+9]-1); 
	}
	for (var i = 0; i < triangles.length; i+=9) {
		indices.push(triangles[i]-1, triangles[i+3]-1, triangles[i+6]-1); 
	}
}
function render() {

    gl.clear( gl.COLOR_BUFFER_BIT);
    update(); 
    for( var i=0; i<indices.length; i+=3)
    {
            if(wireframe==1)
                gl.drawElements( gl.LINE_LOOP, 3, gl.UNSIGNED_BYTE, i );
            else
                gl.drawElements(gl.TRIANGLES,3,gl.UNSIGNED_BYTE,i);
    }
}
function keyPressed(event) {
    switch (event.key) {
        case "ArrowRight":
            press.Txr=true;
            break;
        case "ArrowLeft":
            press.Txl =true;
            break;
        case "ArrowUp":
            press.Tyu =true;
            break;
        case "ArrowDown":
            press.Tyd =true;
            break;
        case "x":
            press.Rotatex=true;
            break;
        case "y":
            press.Rotatey=true;
            break;
        case "z":
            press.Rotatez=true;
            break;
    }
}

function keyReleased(event) {
    switch (event.key) {
        case "ArrowRight":
            press.Txr=false;
            break;
        case "ArrowLeft":
            press.Txl =false;
            break;
        case "ArrowUp":
            press.Tyu =false;
            break;
        case "ArrowDown":
            press.Tyd =false;
            break;
        case "x":
            press.Rotatex=false;
            break;
        case "y":
            press.Rotatey=false;
            break;
        case "z":
            press.Rotatez=false;
            break;
    }
}
//Translate and rotate function update model.
function update()
{

    if (press.Txl==true) {
        modelViewMatrix=mult(translate(-press.Txl,0,0),modelViewMatrix);      
    }

    if (press.Txr==true) {
        modelViewMatrix=mult(translate(press.Txr,0,0),modelViewMatrix);
    }
    if (press.Tyu==true) {
        modelViewMatrix=mult(translate(0,press.Tyu,0),modelViewMatrix);
    }

    if (press.Tyd==true) {
        modelViewMatrix=mult(translate(0,-press.Tyd,0),modelViewMatrix);
    }
    if(press.Rotatex==true)
    {
        modelViewMatrix=mult(rotateX(5),modelViewMatrix);
    }
    if(press.Rotatey==true)
    {
        modelViewMatrix=mult(rotateY(5),modelViewMatrix);
    }
    if(press.Rotatez==true)
    {
        modelViewMatrix=mult(rotateZ(5),modelViewMatrix);
    }
    gl.uniformMatrix4fv( modelViewMatrixLoc, false, flatten(modelViewMatrix));
}
//Arrange orthogonal or perspective projection
function Projection()
{
    projection++;
    if(projection%2==1) // Orthogonal
    {
        console.log("Orthogonal");
        projectionMatrix = ortho(-20.0, 20.0, -20.0, 20.0, -20.0, 20.0);
        Camera.cameraPos=     vec3(0.0, 0.7, 1.2);
        Camera.cameraFront=    vec3(0.0, -0.1, -1.0);
        Camera.cameraUp =    vec3(0.0, 0.1, 0.0);
        modelViewMatrix =  lookAt(Camera.cameraPos, Camera.cameraFront, Camera.cameraUp);
    }
    else
    {
        console.log("Perspective");
        projectionMatrix=perspective(60,aspect,near,far);
        Camera.cameraPos=     vec3(0.0, 0.5, 35.0);
        Camera.cameraFront=  vec3(0.0, -0.5, 1.0);
        Camera.cameraUp=       vec3(0.0, 0.1, 0.0);
        modelViewMatrix =  lookAt(Camera.cameraPos,Camera.cameraFront, Camera.cameraUp);
        
    }
    gl.uniformMatrix4fv( modelViewMatrixLoc, false, flatten(modelViewMatrix));
    gl.uniformMatrix4fv( projectionMatrixLoc, false, flatten(projectionMatrix));
}
function Version()
{
    wireframe++;
    if(wireframe%2==0)
    {
        wireframe=0;
        console.log("Texture-Colored version");
    }
    else
    {
        wireframe=1;
        console.log("Wireframe");
    }
}